/**
 * @suppress
 */
public object FfiConverterTypeIfcScene: FfiConverter<IfcScene, Pointer> {

    override fun lower(value: IfcScene): Pointer {
        return value.uniffiClonePointer()
    }

    override fun lift(value: Pointer): IfcScene {
        return IfcScene(value)
    }

    override fun read(buf: ByteBuffer): IfcScene {
        // The Rust code always writes pointers as 8 bytes, and will
        // fail to compile if they don't fit.
        return lift(Pointer(buf.getLong()))
    }

    override fun allocationSize(value: IfcScene) = 8UL

    override fun write(value: IfcScene, buf: ByteBuffer) {
        // The Rust code always expects pointers written as 8 bytes,
        // and will fail to compile if they don't fit.
        buf.putLong(Pointer.nativeValue(lower(value)))
    }
}



