/**
 * Error type for FFI operations
 */
sealed class IfcException: kotlin.Exception() {
    
    class ParseException(
        
        val `msg`: kotlin.String
        ) : IfcException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class GeometryException(
        
        val `msg`: kotlin.String
        ) : IfcException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class IoException(
        
        val `msg`: kotlin.String
        ) : IfcException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class InvalidHandle(
        ) : IfcException() {
        override val message
            get() = ""
    }
    
    class NotLoaded(
        ) : IfcException() {
        override val message
            get() = ""
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<IfcException> {
        override fun lift(error_buf: RustBuffer.ByValue): IfcException = FfiConverterTypeIfcError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeIfcError : FfiConverterRustBuffer<IfcException> {
    override fun read(buf: ByteBuffer): IfcException {
        

        return when(buf.getInt()) {
            1 -> IfcException.ParseException(
                FfiConverterString.read(buf),
                )
            2 -> IfcException.GeometryException(
                FfiConverterString.read(buf),
                )
            3 -> IfcException.IoException(
                FfiConverterString.read(buf),
                )
            4 -> IfcException.InvalidHandle()
            5 -> IfcException.NotLoaded()
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: IfcException): ULong {
        return when(value) {
            is IfcException.ParseException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is IfcException.GeometryException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is IfcException.IoException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is IfcException.InvalidHandle -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is IfcException.NotLoaded -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
        }
    }

    override fun write(value: IfcException, buf: ByteBuffer) {
        when(value) {
            is IfcException.ParseException -> {
                buf.putInt(1)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is IfcException.GeometryException -> {
                buf.putInt(2)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is IfcException.IoException -> {
                buf.putInt(3)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is IfcException.InvalidHandle -> {
                buf.putInt(4)
                Unit
            }
            is IfcException.NotLoaded -> {
                buf.putInt(5)
                Unit
            }
